import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { NavLink } from "react-router-dom";

export function Footer() {
return (
  <>
<Container>
  <Row>
    <Col className="bg-white shadow-sm" style={{ height: "100px"}}>
  <footer className="d-flex align-item-center" style={{ textDecoration: "none" }}>

    <NavLink to="/" className="p-2">Store
    </NavLink>
    <NavLink to="/contact">Contact us</NavLink>
    <NavLink to="/shoppingcart">Shooping cart</NavLink>
    <strong>Ecommerce @ 2023</strong>
    </footer>
  </Col>
  </Row>
  </Container>
  </>
)
}

export default Footer;
